import React from "react";
import { useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-[#f5f2ee] text-[#5e4b4b] font-serif">
      <h1 className="text-3xl mb-6 font-bold">Welcome to Vellichor Interactive âœ¨</h1>
      <div className="space-x-4">
        <button
          onClick={() => navigate("/login")}
          className="px-6 py-2 bg-[#a78b71] text-white rounded-full hover:bg-[#8b6b50] transition"
        >
          Login
        </button>
        <button
          onClick={() => navigate("/signup")}
          className="px-6 py-2 bg-[#5e4b4b] text-white rounded-full hover:bg-[#3e2f2f] transition"
        >
          Sign Up
        </button>
      </div>
    </div>
  );
};

export default Home;
